sys_variable_value.value:
(function execute(inputs, outputs) {
    var scopeID;
    var getScope = new GlideRecord('sys_app');
    getScope.addQuery('scope',inputs.app_scope);
    getScope.query();

    if( getScope.next()) {
        scopeID =  getScope.sys_id;
    }

    gs.info("gpf id: " + scopeID);

    const params = {
        prompt: inputs.prompt, // required
        additionalPlaybookInfo: {
            label: inputs.pb_name, // required
            sysScope: scopeID.toString() // id of scope
            },
            meta: { // any info you might want used in the callback
                foo: 'bar',
            },
            callbackHandler: "x_snc_15_minute_se.GeneratePlaybookCallbackHandler", // script API name for wherever callback handlers are
            // requestId: "" // optional 
        }

const generateResponse = global.PlaybookDesignerAPI.generatePlaybook(params);
       const {
            url,
            meta,
            requestId
        } = generateResponse;

		outputs.pb_url = inputs.instance_url.toString() + url.toString();

})(inputs, outputs);

